SDL_Real TtoR( SDL_Time D )
{ return (SDL_Real)D.s + (SDL_Real)D.ns*1E-9; }

SDL_Time RtoT( SDL_Real R )
{
  SDL_Time D;
  D.s = (xint32)R;
  D.ns = (xint32)((R - (SDL_Real)D.s)*1E9);
  return D;
}

SDL_Time ItoT( SDL_Integer I )
{
  SDL_Time D;
  D.s = I;
  D.ns = (xint32)0;
  return D;
}

SDL_Real Random( RandomControl Seq )
{
#ifdef XTRACE
  if ( xShouldBeTraced(xRandomTraceLevel, (xPrsNode)0) )
    xPrintString("      Random\n");
#endif
  *Seq = *Seq + (*Seq<<1) + (*Seq<<16);
  return (SDL_Real)((*Seq)/4294967296.0);
}

SDL_Real Erlang( SDL_Real Mean, SDL_Integer r, RandomControl Seq )
{
  SDL_Real Prod;
  int      I;
#ifdef XTRACE
  if ( xShouldBeTraced(xRandomTraceLevel, (xPrsNode)0) )
    xPrintString("      Erlang\n");
#endif
#ifdef XOPERRORF
  if ( (Mean <= 0.0) || (r < 1) ) {
    xSDLOpError("Erlang in sort RandomControl",
                "Illegal parameter");
    return 0.0;
  }
#endif
  Prod = Random(Seq);
  for (I=2; I<=r; I++)
    Prod = Prod*Random(Seq);
  return (-log(Prod)*Mean / r);
}

SDL_Real HyperExp2
  ( SDL_Real Mean1, SDL_Real Mean2, SDL_Real Alpha, RandomControl Seq )
{
  SDL_Real NegExp1;
#ifdef XTRACE
  if ( xShouldBeTraced(xRandomTraceLevel, (xPrsNode)0) )
    xPrintString("      HyperExp2\n");
#endif
#ifdef XOPERRORF
  if ( (Mean1<=0.0) || (Mean2<=0.0) || (Alpha<0.0) || (Alpha>1.0) ) {
    xSDLOpError("HyperExp2 in sort RandomControl",
                "Illegal parameter");
    return 0.0;
  }
#endif
  NegExp1 = -log(Random(Seq));
  if ( Alpha > Random(Seq) )
    return NegExp1*Mean1;
  return NegExp1*Mean2;
}

SDL_Real NegExp( SDL_Real Mean, RandomControl Seq )
{
#ifdef XTRACE
  if ( xShouldBeTraced(xRandomTraceLevel, (xPrsNode)0) )
    xPrintString("      NegExp\n");
#endif
#ifdef XOPERRORF
  if ( Mean <= 0.0 ) {
    xSDLOpError("NegExp in sort RandomControl",
                "Illegal parameter");
    return 0.0;
  }
#endif
  return -log(Random(Seq)) * Mean;
}

SDL_Real Uniform( SDL_Real Low, SDL_Real High, RandomControl Seq )
{
#ifdef XTRACE
  if ( xShouldBeTraced(xRandomTraceLevel, (xPrsNode)0) )
    xPrintString("      Uniform\n");
#endif
#ifdef XOPERRORF
  if ( Low > High ) {
    xSDLOpError("Uniform in sort RandomControl",
                "Illegal parameter");
    return 0.0;
  }
#endif
  return Low + (High-Low)*Random(Seq);
}

SDL_Real Draw( SDL_Real Alpha, RandomControl Seq )
{
#ifdef XTRACE
  if ( xShouldBeTraced(xRandomTraceLevel, (xPrsNode)0) )
    xPrintString("      Draw\n");
#endif
#ifdef XOPERRORF
  if ( (Alpha < 0.0) || (Alpha > 1.0) ) {
    xSDLOpError("Draw in sort RandomControl",
                "Illegal parameter");
    return SDL_False;
  }
#endif
  return Alpha > Random(Seq);
}

SDL_Integer Geometric( SDL_Real p, RandomControl Seq )
{
#ifdef XTRACE
  if ( xShouldBeTraced(xRandomTraceLevel, (xPrsNode)0) )
    xPrintString("      Geometric\n");
#endif
#ifdef XOPERRORF
  if ( (p < 0.0) || (p >= 1.0) ) {
    xSDLOpError("Geometric in sort RandomControl",
                "Illegal parameter");
    return 0;
  }
#endif
  if ( p == 0.0 ) {
    (void)Random(Seq);
    return 0;
  }
  return (SDL_Integer)(log(Random(Seq)) / log(p));
}

