SDL_Integer RandInt(SDL_Integer Low, SDL_Integer High, RandomControl Seq )
{
  SDL_Real U;
#ifdef XTRACE
  if ( xShouldBeTraced(xRandomTraceLevel, (xPrsNode)0) )
    xPrintString("      RandInt\n");
#endif
#ifdef XOPERRORF
  if ( Low > High ) {
    xSDLOpError("RandInt in sort RandomControl",
                "Illegal parameter");
    return 0;
  }
#endif
  U = Random(Seq);
  return (SDL_Integer)(Low*(1.0-U) + High*U + U);
}

RandomControl DefineSeed( SDL_Integer Seed )
{
  RandomControl R;
  R = (RandomControl)xAlloc((xptrint)sizeof(unsigned long));
#ifdef XOPERRORF
  if ( (Seed > 32767) || (Seed < 1) || (Seed%2 == 0) ) {
    xSDLOpError("DefineSeed in sort RandomControl",
                "Illegal Seed value");
    *R = 65537;
    return R;
  }
#endif
  if ( Seed < 8192 )
    *R = 65537*Seed + 8192;
  else
    *R = 65537*Seed;
  return R;
}

SDL_Integer Seed( RandomControl Seq )
{
  return RandInt(1, 16383, Seq)*2 + 1;
}


